import React from 'react'
import { Link, useNavigate } from "react-router-dom";

export default function Welcomecontent() {
  return (
    <>
    <div classsName="container my-4" style={{display:"flex",justifyContent:"center",alignItems:"center",flexDirection:"column",zIndex:"20",position:"absolute",top:"250px",textAlign:"center"}}>
    <div style={{fontSize:"40px"}}>Welcome your</div>
    <Link to="/login" style={{textDecoration:"none",color:"Black"}}>Get started</Link>
    </div>
    </>
    
  )
}
